import defaults, { AxiosSugarConfig } from '../defaults';
import axios from 'axios';
import { AxiosSugarInterceptorManager } from './AxiosSugarInterceptorManager';
import { AxiosRequestConfig, AxiosInstance } from 'axios/index';
import dispatchRequest, { MiddleRequestConfig } from './dispatchRequest'
import initInterceptors from './initInterceptors';
import { repeatTag } from './repeat';
import HttpStatusProcessor from './HttpStatusProcessor';
import MiddleData from './MiddleData';
import { isFn, isNum, isStr } from './utils';
import { merge } from './utils';
import mergeConfig from './mergeConfig';
import { MiddleResponseError } from './dispatchRequest';

const httpStatusProcessor = new HttpStatusProcessor();

export interface Interceptors {
  request: AxiosSugarInterceptorManager;
  response: AxiosSugarInterceptorManager;
}

type Event = 'retried' | 'retryFailed'
| 'stored' | 'repeated'
| 'offline' | 'onlineTimeout' | 'online';

type Events = {
  [key in Event]: Function;
} | {};

interface spreadCallback {
  (...args: unknown[])
}

interface CancelConfig {
  cancel: Function;
  config: MiddleRequestConfig;
}

export class AxiosSugar {
  axios: AxiosInstance;
  interceptors: Interceptors;
  config: AxiosSugarConfig;
  events: Events;
  httpStatusProcessor: HttpStatusProcessor;
  // properties to static
  [key: string]: any;
  get: (url: string, axiosConfig?: AxiosRequestConfig, config?: AxiosSugarConfig) => Promise<any>;
  post: (url: string, axiosConfig?: AxiosRequestConfig, config?: AxiosSugarConfig) => Promise<any>;
  head: (url: string, axiosConfig?: AxiosRequestConfig, config?: AxiosSugarConfig) => Promise<any>;
  options: (url: string, axiosConfig?: AxiosRequestConfig, config?: AxiosSugarConfig) => Promise<any>;
  delete: (url: string, axiosConfig?: AxiosRequestConfig, config?: AxiosSugarConfig) => Promise<any>;
  put: (url: string, axiosConfig?: AxiosRequestConfig, config?: AxiosSugarConfig) => Promise<any>;
  patch: (url: string, axiosConfig?: AxiosRequestConfig, config?: AxiosSugarConfig) => Promise<any>;

  request (axiosConfig: AxiosRequestConfig | MiddleResponseError, config?: AxiosSugarConfig): Promise<any>;
  request (url: string, axiosConfig?: AxiosRequestConfig | MiddleResponseError, config?: AxiosSugarConfig): Promise<any>;
  request (...args): Promise<any> {
    let axiosConfig: AxiosRequestConfig | MiddleResponseError;
    let config: AxiosSugarConfig;
    const _this = this as unknown as AxiosSugar

    if (isStr(args[0])) {
      axiosConfig = args[1] || {};
      (axiosConfig as AxiosRequestConfig).url = args[0];
      config = args[2];
    } else {
      axiosConfig = args[0] || {};
      config = args[1];
    }

    config = config ? mergeConfig(defaults, config) : _this.config;
  
    const chain = [dispatchRequest.bind(this), undefined];
  
    const middleResponseError = (axiosConfig as MiddleResponseError);

    const data = middleResponseError.isAxiosSugarError ? {
      axios: middleResponseError.axios,
      sugar: middleResponseError.sugar,
      count: isNum(middleResponseError.count) ? middleResponseError.count : middleResponseError.count
    } : {
      axios: axiosConfig,
      sugar: config,
      cancelDisabled: false
    };
  
    // dispatch data to dispatchRequest and interceptors
    let promise: Promise<any> = Promise.resolve(data);
  
    _this.interceptors.request.each((interceptor) => {
      chain.unshift(interceptor.fulfilled, interceptor.rejected);
    })
  
    _this.interceptors.response.each((interceptor) => {
      chain.push(interceptor.fulfilled, interceptor.rejected);
    })
  
    while (chain.length) {
      promise = promise.then(chain.shift(), chain.shift());
    }
    
    return promise;
  }

  on (event: Event, fn: Function) {
    this.events[event] = fn;
  }
  
  off (event: Event, fn: Function): Boolean {
    if (this.events[event] === fn) {
      this.events[event] = undefined;
      return true;
    }
    return false;
  }
  // e.g. axiosSugar.get({}, {timeout: 1000})
  constructor (axiosConfig?: AxiosRequestConfig, config?: AxiosSugarConfig) {
    this.httpStatusProcessor = httpStatusProcessor;
    this.axios = axios.create(axiosConfig);
    this.config = config || Object.assign({}, defaults);
    this.events = {};
    this.interceptors = {
      request: new AxiosSugarInterceptorManager(),
      response: new AxiosSugarInterceptorManager()
    };

    initInterceptors(this);
  }
}

['delete', 'get', 'head', 'options'].forEach(function (method) {
  AxiosSugar.prototype[method] = function (
    url: string,
    axiosConfig: AxiosRequestConfig,
    config: AxiosSugarConfig
  ) {
    return this.request(merge(axiosConfig || {}, {
      method: method,
      url: url
    }), config);
  };
});

['post', 'put', 'patch'].forEach(function (method) {
  AxiosSugar.prototype[method] = function (
    url: string, data,
    axiosConfig: AxiosRequestConfig,
    config: AxiosSugarConfig
  ) {
    return this.request(merge(axiosConfig || {}, {
      method: method,
      url: url,
      data: data
    }), config);
  };
});

class AxiosSugarStatic extends AxiosSugar {
  defaults: AxiosSugarConfig;
  axiosDefaults: AxiosRequestConfig;
  axios: AxiosInstance;
  static AxiosSugarStatic: (axiosConfig?: AxiosRequestConfig, config?: AxiosSugarConfig) => AxiosSugar;
  [key: string]: any;
  create (
    axiosConfig?: AxiosRequestConfig,
    config?: AxiosSugarConfig
  ): AxiosSugar {
    if (config) {
      config = mergeConfig(defaults, config);
    }
    return new AxiosSugar(axiosConfig, config);
  }
  
  repeatTag = repeatTag
  
  isCancel (err: MiddleResponseError): Boolean {
    if (err.reason) {
      return axios.isCancel(err.reason);
    } else {
      return false;
    }
  }
  
  getUri (config: AxiosRequestConfig) {
    return axios.getUri(config);
  }
  
  spread (fn: spreadCallback) {
    return axios.spread(fn)
  }
  
  all (...args: unknown[]) {
    return axios.all(args);
  }
  
  cancelAll (): void {
    let cancelConfigs: Array<CancelConfig> = [];
    MiddleData.configs.map(c => {
      if (c !== null) {
        cancelConfigs.push({
          cancel: MiddleData.cancels[c.index],
          config: c
        });
      }
    });
  
    if (isFn(this.cancelFilter)) {
      cancelConfigs = this.cancelFilter(cancelConfigs);
    }
  
    cancelConfigs.forEach(c => {
      c.cancel();
    });
  }

  cancelFilter (cancelConfigs: Array<CancelConfig>): Array<CancelConfig> {
    return cancelConfigs.filter((c) => !c.config.cancelDisabled);
  }
  
  cancelAutoRetry (err: MiddleResponseError) {
    err.sugar.retry.auto = false;
  }

  constructor () {
    super();
    this.defaults = defaults;
    this.axiosDefaults = axios.defaults;
    this.axios = axios;
  }
};

export const SugarStatic = new AxiosSugarStatic();

import { AxiosSugarStorage, AxiosSugarInnerStorage } from './core/AxiosSugarStorage';

interface repeat {
  interval?: number;
}

interface retry {
  auto?: Boolean;
  enable?: Boolean;
  count?: number;
  delay?: number;
}

interface save {
  enable?: Boolean;
  storage?: AxiosSugarStorage;
}

interface reconnect {
  enable?: Boolean;
  delay?: number;
}

interface onlineCheck {
  enable?: Boolean;
  timeout?: number;
  reconnect?: reconnect;
}

export interface AxiosSugarConfig {
  onlineCheck?: onlineCheck;
  repeat?: repeat;
  retry?: retry;
  save?: save;
}

const defaults: AxiosSugarConfig = {
  repeat: {
    interval: 2000
  },
  onlineCheck: {
    enable: false,
    timeout: 5000,
    reconnect: {
      enable: true,
      delay: 5000
    }
  },
  save: {
    enable: false,
    storage:  new AxiosSugarInnerStorage()
  },
  retry: {
    enable: false,
    auto: true,
    count: 3,
    delay: 2000
  }
};

export default defaults;

import {
  deepMerge as deepMergeFn,
  merge as mergeFn
} from 'axios/lib/utils';
import isOnlineFn from 'is-online';

export function capitalize (str: string): string {
  return str.substring(0, 1).toUpperCase() + str.substring(1);
}

export function isDef (value: any): boolean {
  return typeof value !== 'undefined';
}

export function isStr (value: any): boolean {
  return typeof value === 'string';
}

export function isError (value) {
  return value instanceof Error;
}

export function getDurationMS (a: number, b: number): number {
  return a - b;
}

export function notUndef<T = any, D = any> (targetVal: T, defaultVal: D): T | D {
  return typeof targetVal === 'undefined' ? defaultVal : targetVal;
}

function customMessage (msg: string) {
  return `[axios-sugar]: ${msg}.`;
}

export function log (msg: string) {
  console.log(customMessage(msg));
}

export function warn (msg: string) {
  console.warn(customMessage(msg));
}

export function error (msg: string) {
  console.error(customMessage(msg));
}

export function throwError (msg: string) {
  throw new Error(customMessage(msg));
}

export function isDev () {
  return process.env.NODE_ENV === 'development';
}

export function isFn (val) {
  return typeof val === 'function';
}

export function isNum (val) {
  return typeof val === 'number';
}

export function isPlainObject (val) {
  return typeof val === 'object' && val !== null && !Array.isArray(val);
}

export function deepMerge (...args) {
  return deepMergeFn.apply(null, args);
}

export function merge (...args) {
  return mergeFn.apply(null, args);
}

interface onlineOptions {
  timeout?: number
}

export function isOnline (options: onlineOptions = {timeout: 5000}) {
  return isOnlineFn({
    timeout: options.timeout
  });
}

interface ManagerHandler {
  fulfilled: Function;
  rejected: Function;
}

export class AxiosSugarInterceptorManager {
  private handlers: Array<ManagerHandler>;
  constructor () {
    this.handlers = [];
  }

  use (fulfilled: Function, rejected: Function) {
    this.handlers.push({
      fulfilled,
      rejected
    });

    return this.handlers.length - 1;
  }

  eject (i: number) {
    if (this.handlers[i]) {
      this.handlers[i] = null
    }
  }

  each (fn: Function) {
    this.handlers.forEach((handler: ManagerHandler) => {
      if (handler !== null) {
        fn(handler)
      }
    })
  }
}

import { AxiosRequestConfig, AxiosError, AxiosResponse } from 'axios/index';
import { AxiosSugarConfig } from '../defaults';
import storage from './storage';

export interface MiddleRequestConfig {
  axios: AxiosRequestConfig;
  sugar: AxiosSugarConfig;
  index: number;
  count?: number;
  cancelDisabled?: Boolean;
  sendingTime: number;
  cacheTime?: number;
  completeTime: number;
}

export interface MiddleResponseConfig {
  completeTime: number;
  response: AxiosResponse;
  sugar: AxiosSugarConfig;
  index: number;
  count?: number;
  sendingTime: number;
  cacheTime?: number;
}

export class MiddleResponseError extends Error {
  reason: AxiosError | Error;
  axios: AxiosRequestConfig;
  sugar: AxiosSugarConfig;
  index: number;
  count?: number;
  sendingTime: number;
  completeTime: number;
  cacheTime?: number;
  isAxiosSugarError: Boolean;
  name: string;

  constructor (reason, config) {
    super(reason.message);
    this.name = new.target.name;
    if (typeof (Error as any).captureStackTrace === 'function') {
      (Error as any).captureStackTrace(this, new.target);
    }
    if (typeof Object.setPrototypeOf === 'function') {
      Object.setPrototypeOf(this, new.target.prototype);
    } else {
      (this as any).__proto__ = new.target.prototype;
    }
    this.reason = reason;
    this.axios = config.axios;
    this.index = config.index;
    this.sugar = config.sugar;
    this.count = config.count;
    this.sendingTime = config.sendingTime;
    this.completeTime = config.completeTime;
    this.isAxiosSugarError = true;
  }
}

export default function (
  config: MiddleRequestConfig
): Promise<MiddleResponseConfig | MiddleResponseError> {
  const cache = config.sugar.save.enable ? storage.get(config) : null;
  config.sendingTime = new Date().getTime();

  if (cache !== null) {
    return Promise.resolve({
      response: cache.response,
      sugar: config.sugar,
      index: config.index,
      sendingTime: config.sendingTime,
      cacheTime: cache.time,
      completeTime: new Date().getTime()
    })
  } else {
    return this.axios.request(config.axios).then((response) => {
      config.completeTime = new Date().getTime();

      return {
        response,
        sugar: config.sugar,
        index: config.index,
        sendingTime: config.sendingTime,
        completeTime: config.completeTime
      }
    }, (reason) => {
      config.completeTime = new Date().getTime();

      const error = new MiddleResponseError(reason, config);

      return Promise.reject(error);
    });
  }
}

import { MiddleRequestConfig, MiddleResponseConfig } from './dispatchRequest';
import MiddleData from './MiddleData';
import { AxiosResponse } from 'axios/index';

export interface StorageData {
  response: AxiosResponse;
  time: number;
  [key: string]: any;
}

export default {
  get (config: MiddleRequestConfig): StorageData | null {
    const save = config.sugar.save;
  
    if (save.enable) {
      const storage = save.storage;
      const tag = MiddleData.tags[config.index];

      if (tag !== null) {
        return storage.get(tag);
      }
    }

    return null;
  },
  set (config: MiddleResponseConfig): Boolean {
    const save = config.sugar.save;

    if (save.enable) {
      const storage = save.storage;
      const tag = MiddleData.tags[config.index];
      // isn't cancel request
      if (tag !== null) {
        storage.set(tag, {
          response: config.response,
          time: new Date().getTime()
        });
        return true;
      }
    }

    return false;
  }
}

import { MiddleRequestConfig } from './dispatchRequest';

/**
 * store data generated in chain
 */
interface MiddleData {
  tags: Array<string>,
  cancels: Array<Function>,
  configs: Array<MiddleRequestConfig>
}

const middleData: MiddleData = {
  tags: [],
  cancels: [],
  configs: [] // middleRequestConfig Array
};

// destory some special data in MiddleData
export function dataDestory (index) {
  middleData.configs[index] = null;

  if (middleData.tags[index] !== null) {
    middleData.tags[index] = null;
    middleData.cancels[index] = null;
  }
}

export default middleData;

import { AxiosSugar } from './AxiosSugar';
import { MiddleRequestConfig, MiddleResponseConfig, MiddleResponseError } from './dispatchRequest';
import MiddleData, { dataDestory } from './MiddleData';
import { isFn, isDef } from './utils';
import repeat, { isInInterval } from './repeat';
import storage from './storage';
import { AxiosError } from 'axios';
import normalize from './normalizeHttpStatusProcessorResult';

export default function initInterceptors (axiosSugar: AxiosSugar) {
  axiosSugar.interceptors.request.use((config: MiddleRequestConfig) => {

    MiddleData.configs.push(config);

    // handle repeated requests
    config.index = repeat.call(axiosSugar, config);

    return config;
  }, (err: Error) => {
    return Promise.reject(err);
  });

  axiosSugar.interceptors.response.use((config: MiddleResponseConfig) => {
    // store response
    if (storage.set(config)) {
      const stored = axiosSugar.events['stored'];
      if (isFn(stored)) {
        stored.call(axiosSugar, config);
      }
    }

    // destory middle data about this request
    if (!isInInterval(config.sendingTime, config.completeTime, config.sugar.repeat.interval)) {
      dataDestory(config.index);
    }

    return axiosSugar.httpStatusProcessor.dispatch(
      axiosSugar,
      config.response.status.toString(),
      config
    );
  }, (err) => {
    let result: any = err;

    // destory middle data about this request
    if (
      (err.reason &&
      !isInInterval(err.sendingTime, err.completeTime, err.sugar.repeat.interval))
    ) {
      dataDestory(err.index);
    }

    // only handle http-status-code error
    if (err.reason && (err.reason as AxiosError).response) {
      result = axiosSugar.httpStatusProcessor.dispatch(
        axiosSugar,
        (err.reason as AxiosError).response.status.toString(),
        err
      );
    }

    result = normalize(result);

    // delete middle data when encountered repeated request
    if (result instanceof Promise && err.count >= 1) {
      dataDestory(err.index);
    }
    
    return result instanceof Promise ? result : Promise.reject(result || err);
  });
}

import { AxiosRequestConfig } from 'axios/index';
import { MiddleRequestConfig } from './dispatchRequest';
import { AxiosSugarConfig } from '../defaults';
import axios from 'axios';
import MiddleData from './MiddleData';
import { isDef, isFn, getDurationMS, deepMerge, throwError } from './utils';
import { AxiosSugar, SugarStatic } from './AxiosSugar';
import { dataDestory } from './MiddleData';

// where the sending data in ? (params or data)
function sendDataWay (method: string): 'data' | 'params' {
  const isInData = ['post', 'put', 'patch'].indexOf(method) >= 0;
  return isInData ? 'data' : 'params';
}

function querystring (url) {
  let result = {};
  const index = url.indexOf('?');
  if (index >= 0) {
    const arr = url.trim().substring(url.indexOf()).split('&');
    arr.forEach(item => {
      const arr = item.trim().split('=');
      if (arr.length === 1) {
        result[arr[0]] = '';
      } else {
        result[arr[0]] = result[arr[1]];
      }
    });
  }

  return result;
}

function getDataString (data) {
  return data ? JSON.stringify(data) : '';
}

export function genSymbol (config: AxiosRequestConfig): string {
  let { url } = config;
  const { method } = config;
  // the data send before
  let data;

  // get the sent data
  switch (sendDataWay(method)) {
    case 'params': {
      data = config.params || {};
      if (method === 'get') {
        data = deepMerge(querystring(url), data);
      }

      data = getDataString(data);

      break;
    }
    case 'data': data = getDataString(config.data);
  }

  return `method=${method}&url=${url}&data=${data}`;
}

export function isInInterval (sendingTime: number, completeTime: number, interval: number): Boolean {
  return getDurationMS(completeTime, sendingTime) < interval;
}

export function repeatTag (
  axiosConfig: AxiosRequestConfig,
  config?: AxiosSugarConfig
): string {
  return genSymbol(axiosConfig);
}

export default function (
  config: MiddleRequestConfig
): number {
  const tag = SugarStatic.repeatTag(config.axios, config.sugar);
  let i = MiddleData.tags.indexOf(tag);

  // destory exceeded records
  if (
    i >= 0 &&
    // maybe the previous request hasn't been sent
    MiddleData.configs[i].sendingTime &&
    !isInInterval(
      MiddleData.configs[i].sendingTime,
      new Date().getTime(),
      config.sugar.repeat.interval
    )
  ) {
    dataDestory(i);
    // tag has been destoryed
    i = -1;
  }

  // call repeated
  const callRepeated = () => {
    const repeated = (this as AxiosSugar).events['repeated'];
    if (isFn(repeated)) {
      repeated.call(this, config);
    }
  }

  // if repeat
  if (i >= 0) {
    // if the previous request has been completed
    if (MiddleData.configs[i] && MiddleData.configs[i].completeTime) {
      callRepeated();
      // throw an error to cancel current request
      throwError('The current request is repeated.');
    } else {
      // cancel the repeated request sent before
      MiddleData.cancels[i]('The previous request is repeated.');
      MiddleData.tags[i] = null;
      MiddleData.cancels[i] = null;
      callRepeated();
    }
  }

  const source = axios.CancelToken.source();
  config.axios.cancelToken = source.token;
  MiddleData.cancels.push(source.cancel);

  return MiddleData.tags.push(tag) - 1;
}

import { isDef, isError } from './utils';

class ReasonError extends Error {
  reason: Error;
  [key: string]: any;

  constructor (error) {
    super(error.message);
    this.name = new.target.name;
    if (typeof (Error as any).captureStackTrace === 'function') {
      (Error as any).captureStackTrace(this, new.target);
    }
    if (typeof Object.setPrototypeOf === 'function') {
      Object.setPrototypeOf(this, new.target.prototype);
    } else {
      (this as any).__proto__ = new.target.prototype;
    }
    this.reason = error;
  }
}

function dataType (data) {
  if (isDef(data)) {
    if (data instanceof Promise) {
      return 'promise';
    }
    if (isError(data as unknown)) {
      if (isDef(data.reason)) {
        return 'reasonError';
      }
      // general error
      return 'error';
    }
  } else {
    return 'undefined';
  }
}

function transformSyncData (data) {
  switch (dataType(data)) {
    case 'undefined': return;
    case 'error': return new ReasonError(data);
    case 'reasonError': return data;
    default: return 'promise';
  }
}

export default (data) => {
  const result = transformSyncData(data);

  if (result === 'promise') {
    return data.then(
      (data) => transformSyncData(data),
      (data) => transformSyncData(data)
    );
  } else {
    return result;
  }
}

import { error, isDev, warn, isOnline, isFn, capitalize } from './utils';
import { AxiosError } from 'axios/index';
import retryFn from './retry';
import { MiddleResponseConfig, MiddleResponseError } from './dispatchRequest';
import { AxiosSugar } from './AxiosSugar';

interface retry {
  (): Boolean
}

interface handlerFn {
  (
    status?: string,
    payload?: MiddleResponseError | MiddleResponseConfig,
    result?: any,
    retry?: retry
  ): any;
}

// 1XX -> 5XX
const statusKinds = [
  '1', '2', '3', '4', '5'
];

class HttpStatusProcessorPrototype {
  protected statusTable: Object;
  protected reservedCodes: string[];
  [key: string]: any;

  constructor () {
    this.statusTable = {
      // 200: this.onOk,
      // 201: this.onCreated,
      // 202: this.onAccepted,
      // 203: this.onNonAuthoritativeInformation,
      // 204: this.onNoContent,
      // 205: this.onResetContent,
      // 206: this.onPartialContent,
      // 207: this.onMultiStatus,
      400: this.onBadRequest,
      401: this.onUnauthorized,
      403: this.onForbidden,
      404: this.onNotFound,
      405: this.onMethodNotAllow,
      406: this.onNotAcceptable,
      407: this.onProxyAuthenticationRequired,
      408: this.onTimeout,
      409: this.onConflict,
      500: this.onInternalServerError,
      501: this.onNotImplemented,
      502: this.onBadGateway
    }

    this.reservedCodes = Object.keys(this.statusTable);
  }

  setStatusHandler (status: string, fn: handlerFn): Boolean {
    if (this.reservedCodes.indexOf(status) < 0) {
      this.statusTable[status] = fn;
      return true;
    } else if (isDev()) {
      error(`can't set the handler of http status code ${status}.`);
    }
    return false;
  }

  // disptach to status handlers
  dispatch (axiosSugar: AxiosSugar, status: string, payload: MiddleResponseError | MiddleResponseConfig) {
    const firstCode = status.toString().substr(0, 1);
    // expect a response
    // if payload is an error, the result will be undefined,
    // but don't worry, because it will be handled in interceptor.
    let result = (payload as MiddleResponseConfig).response;
    let isRetried = false;
    let retriedRequest = undefined;

    // if can retry
    const retry: retry = (
      (payload as MiddleResponseError).reason && 
      payload.sugar.retry.enable
    ) ? function () {
      if (!isRetried) {
        isRetried = true;
        retriedRequest = retryFn.call(axiosSugar, payload);

        return true;
      } else if (isDev()) {
        warn('retry has been already called');
      }

      return false;
    } : undefined;

    function handlerCall (fn: handlerFn, result: any) {
      return fn.call(axiosSugar, status, payload, result, retry);
    }
    
    if (isFn(this[`on${firstCode}XXBefore`])) {
      result = handlerCall(this[`on${firstCode}XXBefore`], result);
    } else if (isFn(this.onStatusBefore)) {
      result = handlerCall(this.onStatusBefore, result);
    }

    if (isFn(this.statusTable[status])) {
      result = handlerCall(this.statusTable[status], result);
    }

    if (isFn(this[`on${firstCode}XXAfter`])) {
      result = handlerCall(this[`on${firstCode}XXAfter`], result);
    } else if (isFn(this.onStatusAfter)) {
      result = handlerCall(this.onStatusAfter, result);
    }

    return retriedRequest || result;
  }
}

class HttpStatusProcessor extends HttpStatusProcessorPrototype {}

const errorhandlers = [
  'BadRequest',
  'Unauthorized',
  'Forbidden',
  'NotFound',
  'MethodNotAllow',
  'NotAcceptable',
  'ProxyAuthenticationRequired',
  // 'Timeout',
  'Conflict',
  'InternalServerError',
  'NotImplemented',
  'BadGateway'
];

function autoRetry (axiosSugar: AxiosSugar, err: MiddleResponseError, retry: retry) {
  if (retry && err.sugar.retry.auto) {
    // retry() returns false means that it has been already retried before.
    if (!retry()) {
      warn('retry has been already retried before')
    } 
  }
}

errorhandlers.forEach(h => {
  HttpStatusProcessor.prototype['on' + h] = function (
    status: string,
    err: MiddleResponseError,
    result: any,
    retry?: retry
  ): AxiosError {
    if (isDev()) {
      error(err.reason.message);
    }

    autoRetry((this as AxiosSugar), err, retry);

    return err.reason as AxiosError;
  };
});

HttpStatusProcessor.prototype.on = function (event: string, fn: handlerFn) {
  this['on' + capitalize(event)] = fn;
};

HttpStatusProcessor.prototype['onTimeout'] = async function (
  status: string,
  err: MiddleResponseError,
  result: any,
  retry?: retry
): Promise<AxiosError> {
  const onlineCheck = err.sugar.onlineCheck

  if (onlineCheck.enable) {
    if (await isOnline({
      timeout: onlineCheck.timeout
    })) {
      if (isDev()) {
        error(`online but timeout`);
      }
      const onlineTimeout = this.events['onlineTimeout'];
      if (isFn(onlineTimeout)) {
        this.events['onlineTimeout'].call(this, err, retry);
      }
      autoRetry((this as AxiosSugar), err, retry);
    } else {
      if (isDev()) {
        error(`offline`);
      }
      const offline = this.events['offline'];
      if (isFn(offline)) {
        this.events['offline'].call(this, err);
      }
      // retry when online
      if (onlineCheck.reconnect.enable) {
        const timer = setInterval(() => {
          const online = this.events['online'];
          if (isFn(online)) {
            this.events['online'].call(this, err, retry);
            clearInterval(timer);
            autoRetry((this as AxiosSugar), err, retry);
          }
        }, onlineCheck.reconnect.delay);
      }
    }
  } else {
    if (isDev()) {
      error(err.reason.message);
    }
    autoRetry((this as AxiosSugar), err, retry);
  }

  return err.reason as AxiosError;
}

export default HttpStatusProcessor;

import { MiddleResponseError } from './dispatchRequest';
import { isNum, isFn } from './utils';
import { AxiosSugar } from './AxiosSugar';

export default function (err: MiddleResponseError) {
  const _this = this as AxiosSugar;

  if (isNum(err.count)) {
    err.count += 1;
  } else {
    err.count = 1;
  }

  if (
    isNum(err.sugar.retry.count) &&
    err.count <= err.sugar.retry.count
  ) {
    const retried = _this.events['retried'];
    if (retried) {
      retried.call(_this, err);
    }
    return new Promise((resolve) => {
     setTimeout(function () {
      resolve(_this.request(err));
     }, err.sugar.retry.delay);
    });
  } else {
    const retryFailed = _this.events['retryFailed'];

    if (isFn(retryFailed)) {
      retryFailed.call(_this, err);
    }

    return Promise.reject(err);
  }
}

import { deepMerge } from "./utils";
import { AxiosSugarConfig } from "../defaults";

export default function mergeConfig (target: AxiosSugarConfig, source: AxiosSugarConfig) {
  const result = deepMerge(target, source);

  // handle storage
  if (source.save && source.save.storage) {
    result.save.storage = source.save.storage;
  } else {
    result.save.storage = target.save.storage;
  }

  return result;
}
